import React from 'react';
import Col from "react-bootstrap/Col";
import InputGroup from 'react-bootstrap/InputGroup';
import Image from "react-bootstrap/Image";
import Form from "react-bootstrap/Form";

const MySelector = ({ img, item}) => (
                                    <Col xs={4} >

                                        <InputGroup style={{height: '50px',marginBottom:'5px'}}>
                                            <InputGroup.Prepend>
                                                <Image alt=''
                                                       src={img}
                                                       style={{pointerEvents: 'none'}}/>

                                            </InputGroup.Prepend>

                                            <Form.Control className='mySelector' style={{background: 'url(http://wpandyou.ru/wp-content/uploads/2013/01/down_arrow_select.jpg) no-repeat right #DDD' }} as="select">

                                                {item.map((val,key) =>{
                                                    return <option key={key} >{val} </option>
                                                })}

                                            </Form.Control>
                                        </InputGroup>
                                    </Col>

);
export default MySelector;
